import Messages from "./messages";
import FriendInformation from "./friendInformation";
import UsersList from "./usersList";
import "./conversationScreen.css";
function ConversationScreen(){
      return <div className="allWrapper">
            <UsersList className="usersListWrapper"  />
            <Messages className="messagesWrapper"/>
            <FriendInformation className="friendInformationWrapper" />
      </div>
} 
export default ConversationScreen ;
